import React, { useContext } from 'react';
import { NavLink } from 'react-router-dom';
import './NavBar.css';

const NavBar = (props) => {
   return (
    <nav className="nav-bar">
      <ul className="nav-links">
        <li>
          <NavLink>
            HOME
          </NavLink>
        </li>
        <li>
          <NavLink>
            ORDER
          </NavLink>
        </li>
        <li>
          <NavLink>
            CART
          </NavLink>
        </li>
      </ul>
    </nav>
  );

  /*
    {auth.isLoggedIn && (
      <li>
        <NavLink to="#">ACCOUNT</NavLink>
      </li>
    )}
    {!auth.isLoggedIn && (
      <li>
        <NavLink to="#">LOGIN</NavLink>
      </li>
    )}
  */    
};

export default NavBar;
